import axios from 'axios';


const URL = 'http://localhost:5000';



export const getAuth = async () => {
    try {
      axios.get(`${URL}/test`,{headers: {'Access-Control-Allow-Origin': '*'}})
      .then(response => console.log(response.data));
  
     
    
    } catch(err) {
      console.log(err)
    }
  };
